import React from 'react'
import './Admincss.css';
import { Link } from 'react-router-dom';

export default function Adminlogin() {
  return (
    <div className='adm'>
     
      <div className='log'>
      <h1>Admin Login</h1>
        <div className='mnq'>
        <label className='lb1'>Username :</label><br/>
        <input placeholder='Enter Username' type='text' className='inp1'/><br/><br/>
        <label className='lb1'>Password :</label><br/>
        <input placeholder='Enter Username' type='password' className='inp1'/>
        <Link to="/" className='ln1'>L</Link>
        </div>
      </div>
    </div>
  )
}
